import { Input, Component } from "@angular/core";

@Component({
    selector: 'app-head-layout',
    templateUrl: './head-layout.component.html',
})
export class HeadLayoutComponent {
    @Input()
    onMenuClick: () => void;

    onClick() {
        console.log('onMenuClick called');
        this.onMenuClick();
    }

    title = 'Notes';
}
